import s from "./AppBar.module.css"
import {NavLink} from "react-router-dom";

const activeStyles = {
    activeLink: {
        color: '#E84A5F'
    }
}


const AppBar = () => {

    return <>
        <div className={s.leftContainer}>
            <NavLink to={'/home'} className={s.item} activeStyle={activeStyles.activeLink}>Home</NavLink>
            <NavLink to={'/Phonebook'} className={s.item} activeStyle={activeStyles.activeLink}>Phonebook</NavLink>

        </div>
        <div className={s.rightContainer}>
            <NavLink to={'/registration'} className={s.item} activeStyle={activeStyles.activeLink}>Registration</NavLink>
            <NavLink to={'/auth'} className={s.item} activeStyle={activeStyles.activeLink}>Authentication</NavLink>
        </div>

    </>
}

export default AppBar
